import axios from "axios";

export const getWeatherList = async () => {
    const weather = await axios.get(
        `https://symbolsofindonesia.vercel.app/provinces/200`
    );

    return weather.data;
};

export const getDetailWeather = async () => {
    const weather = await axios.get(
        `https://symbolsofindonesia.vercel.app/provinces/:index/:size`
    );
    return weather.data.data;
};

